import React from "react";


/**
 * Membuat Component Header
 */
function Header() {
  return (
    <div>
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>  
    </div>
  );
}

// export Component Header
export default Header;
